import React from 'react';

interface IProps {}

interface IState {
    msg:string;
}

class Welcome extends React.Component<IProps, IState>{

    constructor(props:IProps) {
        super(props);
        this.state={
            msg:'Good Morning'
        }
    }

    render() {
        return (
            <React.Fragment>
                <h1>Welcome Components</h1>
                <h3>{this.state.msg}</h3>
            </React.Fragment>
        );
    }
}
export default Welcome;
